import React from 'react';
import Header from './Header'; // Assuming Header.js is in the same folder
import './Concerns.css'; // Assuming you have a Concerns.css file for styling

const Concerns = ({ navigateTo }) => {
  const handleConcernClick = (concern) => {
    console.log(`Selected concern: ${concern}`);
    navigateTo(concern.toLowerCase().replace(' ', '-')); // Navigate to the selected concern page
  };

  return (
    <div className="concerns-page">
      <Header navigateTo={navigateTo} />
      <div className="concerns-grid">
        <div className="concern dryness" onClick={() => navigateTo('product12')}>
          <h3>Dryness</h3>
          <p>Product to combat dry hair</p>
        </div>
        <div className="concern damage" onClick={() => navigateTo('damaged-hair')}>
          <h3>Damage</h3>
          <p>Product to repair damaged hair</p>
        </div>
        <div className="concern frizz" onClick={() => navigateTo('frizzy-hair')}>
          <h3>Frizz</h3>
          <p>Product to manage frizzy hair</p>
        </div>
        <div className="concern curl-support" onClick={() => navigateTo('curly-hair')}>
          <h3>Curl Support</h3>
          <p>Product to enhance curl definition</p>
        </div>
      </div>
    </div>
  );
};

export default Concerns;
